import React, { useCallback } from "react";
import Head from "next/head";
import AppLayout from "../components/AppLayout";

const Signup = () => {
  const onSubmit = useCallback(() => {});
  return (
    <>
      <AppLayout>
        <Head>
          <meta charSet="utf-8" />
          <title>노드버드 | 회원가입</title>
        </Head>
        <div>회원가입 페이지</div>
      </AppLayout>
    </>
  );
};

export default Singup;
